#include <stdio.h>
#include <stdlib.h>
#include <string.h>
#include <time.h>
#include <omp.h>

#define SIZE (100*1024*1024)  // 100 million elements = ~800MB

int main() {
    double *a = malloc(SIZE * sizeof(double));
    double *b = malloc(SIZE * sizeof(double));
    double *c = malloc(SIZE * sizeof(double));

    // Initialize
    #pragma omp parallel for
    for(long i = 0; i < SIZE; i++) {
        a[i] = 1.0;
        b[i] = 2.0;
        c[i] = 0.0;
    }

    printf("Memory Bandwidth Benchmark (Array size: %.1f MB)\n", SIZE * sizeof(double) / 1024.0 / 1024.0);
    printf("Using %d threads\n\n", omp_get_max_threads());

    // Copy: c = a
    clock_t start = clock();
    #pragma omp parallel for
    for(long i = 0; i < SIZE; i++) c[i] = a[i];
    double copy_time = (double)(clock() - start) / CLOCKS_PER_SEC;
    double copy_bw = (2.0 * SIZE * sizeof(double)) / copy_time / 1e9;

    // Scale: b = scalar * c
    start = clock();
    #pragma omp parallel for
    for(long i = 0; i < SIZE; i++) b[i] = 3.0 * c[i];
    double scale_time = (double)(clock() - start) / CLOCKS_PER_SEC;
    double scale_bw = (2.0 * SIZE * sizeof(double)) / scale_time / 1e9;

    // Add: c = a + b
    start = clock();
    #pragma omp parallel for
    for(long i = 0; i < SIZE; i++) c[i] = a[i] + b[i];
    double add_time = (double)(clock() - start) / CLOCKS_PER_SEC;
    double add_bw = (3.0 * SIZE * sizeof(double)) / add_time / 1e9;

    // Triad: a = b + scalar * c
    start = clock();
    #pragma omp parallel for
    for(long i = 0; i < SIZE; i++) a[i] = b[i] + 3.0 * c[i];
    double triad_time = (double)(clock() - start) / CLOCKS_PER_SEC;
    double triad_bw = (3.0 * SIZE * sizeof(double)) / triad_time / 1e9;

    printf("Operation      Bandwidth\n");
    printf("Copy:          %.2f GB/s\n", copy_bw);
    printf("Scale:         %.2f GB/s\n", scale_bw);
    printf("Add:           %.2f GB/s\n", add_bw);
    printf("Triad:         %.2f GB/s\n", triad_bw);

    free(a); free(b); free(c);
    return 0;
}
