#include <stdio.h>
#include <stdlib.h>
#include <string.h>
#include <omp.h>

#define SIZE (100*1024*1024)
#define ITERATIONS 5

int main() {
    double *a = malloc(SIZE * sizeof(double));
    double *b = malloc(SIZE * sizeof(double));
    double *c = malloc(SIZE * sizeof(double));

    #pragma omp parallel for
    for(long i = 0; i < SIZE; i++) {
        a[i] = 1.0; b[i] = 2.0; c[i] = 0.0;
    }

    printf("STREAM-like Memory Bandwidth Benchmark\n");
    printf("Array size: %.1f MB per array, %.1f MB total\n", 
           SIZE * sizeof(double) / 1024.0 / 1024.0,
           3 * SIZE * sizeof(double) / 1024.0 / 1024.0);
    printf("Threads: %d\n\n", omp_get_max_threads());

    double copy_bw = 0, scale_bw = 0, add_bw = 0, triad_bw = 0;

    for(int iter = 0; iter < ITERATIONS; iter++) {
        double start, end;

        start = omp_get_wtime();
        #pragma omp parallel for
        for(long i = 0; i < SIZE; i++) c[i] = a[i];
        end = omp_get_wtime();
        copy_bw += (2.0 * SIZE * sizeof(double)) / (end - start) / 1e9;

        start = omp_get_wtime();
        #pragma omp parallel for
        for(long i = 0; i < SIZE; i++) b[i] = 3.0 * c[i];
        end = omp_get_wtime();
        scale_bw += (2.0 * SIZE * sizeof(double)) / (end - start) / 1e9;

        start = omp_get_wtime();
        #pragma omp parallel for
        for(long i = 0; i < SIZE; i++) c[i] = a[i] + b[i];
        end = omp_get_wtime();
        add_bw += (3.0 * SIZE * sizeof(double)) / (end - start) / 1e9;

        start = omp_get_wtime();
        #pragma omp parallel for
        for(long i = 0; i < SIZE; i++) a[i] = b[i] + 3.0 * c[i];
        end = omp_get_wtime();
        triad_bw += (3.0 * SIZE * sizeof(double)) / (end - start) / 1e9;
    }

    printf("Operation      Bandwidth (Average of %d runs)\n", ITERATIONS);
    printf("--------------------------------------------\n");
    printf("Copy:          %.2f GB/s\n", copy_bw / ITERATIONS);
    printf("Scale:         %.2f GB/s\n", scale_bw / ITERATIONS);
    printf("Add:           %.2f GB/s\n", add_bw / ITERATIONS);
    printf("Triad:         %.2f GB/s\n", triad_bw / ITERATIONS);

    free(a); free(b); free(c);
    return 0;
}
