cat > /tmp/latency.c << 'EOF'
#include <stdio.h>
#include <stdlib.h>
#include <time.h>

#define ARRAY_SIZE (64*1024*1024)  // 64M elements
#define ITERATIONS 100000000

int main() {
    long *array = malloc(ARRAY_SIZE * sizeof(long));

    // Create random access pattern (linked list in array)
    for(long i = 0; i < ARRAY_SIZE - 1; i++) {
        array[i] = (i + 4096) % ARRAY_SIZE;  // Jump by ~32KB
    }
    array[ARRAY_SIZE - 1] = 0;

    // Warm up cache
    volatile long idx = 0;
    for(int i = 0; i < 1000; i++) {
        idx = array[idx];
    }

    // Measure latency
    struct timespec start, end;
    clock_gettime(CLOCK_MONOTONIC, &start);

    idx = 0;
    for(long i = 0; i < ITERATIONS; i++) {
        idx = array[idx];
    }

    clock_gettime(CLOCK_MONOTONIC, &end);

    double elapsed = (end.tv_sec - start.tv_sec) + 
                     (end.tv_nsec - start.tv_nsec) / 1e9;
    double latency_ns = (elapsed / ITERATIONS) * 1e9;

    printf("Memory Latency Test\n");
    printf("Array size: %ld MB\n", (ARRAY_SIZE * sizeof(long)) / 1024 / 1024);
    printf("Random access latency: %.2f ns\n", latency_ns);
    printf("(Dummy: %ld)\n", idx);

    free(array);
    return 0;
}
EOF
